import Chessboard from '@chrisoakman/chessboardjs';

const App = () => {
  useEffect(() => {
    const board = Chessboard('myBoard', {
      draggable: true,
      dropOffBoard: 'trash',
      sparePieces: true,
    });

    // Use the board variable if needed
    // For example: board.start();
  }, []);

  return (
    <div>
      <div id="myBoard" style={{ width: '400px' }}></div>
    </div>
  );
};

export default App;
